import './App.css';
import Tumorboard from './components/Tumorboardinterface';
import Patient from './Componentspatient/Patientinterface';
import Doctor from './ComponentsDoctor/DoctorInterface';
import Conclusion from './ComponentsDoctor/Conclusion';
import { BrowserRouter as Router, Switch, Route, Link } from "react-router-dom";

function App() {
  return (
    <div className="App">
      <div id="header" style={{ background: '#eee' }}>

          <div id="sub_header">
            <div id="header_sec_1">
                <img src={mainlogo.png} alt="My logo" />
            </div>
            <div id="header_sec_2">
              <div id="header_buttons">
                 </div>
            </div>
            <div id="header_sec_3">
              <i className="fas fa-user" />
            </div>
          </div>

                </div>
      <Router>
        <Route path="/tumorboardinterface" component={Tumorboard}></Route>
        <Route path="/patient" component={Patient}></Route>
        <Route path="/doctor" component={Doctor}></Route>
        <Route path="/conclusion" component={Conclusion}></Route>

      </Router>

    </div>
  );
}

export default App;
